howToParticipate.answer:
1. рІерѕџрЇѕрѕѕрїѕрІЇріЋ рѕЮрѕГрЅхрІјріЋ рІГрѕЮрѕерїА; 
2. "рїЇрІЏ" ріЋ рїарЅЁ рІФрІхрѕГрїЅ; 
3. рЅЦрІЏрЅ▒ріЋ рІГрѕЮрѕерїА; 
4. рІерЅ░рѕЪрѕІ ріГрЇЇрІФ. 
ріерЅ░рѕ│ріФ рЅ░рѕ│рЅхрЇј рЅаріІрѕІ, рЅ░рїЊрІ│ріЮ рІЋрІхрѕѕріЏ рі«рІх рІГрЅђрЅарѕІрѕЅ.

withdrawRejected.answer:
рІерѕЏрѕхрІѕрїѕрїЃ рїЦрІФрЅёрІјрЅй рѕѕрѕџріерЅ░рѕЅрЅх рѕЮріГріЋрІФрЅХрЅй рІЇрІхрЅЁ рѕірѕєріЉ рІГрЅйрѕІрѕЅ -1. рІерЅ░рѕ│рѕ│рЅ░ рІерѕЏрѕхрІѕрїѕрїЃ ріарІхрѕФрѕ╗ рЅЁрѕГрїИрЅх; 
2. рЅарЅѓ рІФрѕЇрѕєріљ рІерѕѓрѕ│рЅЦ рѕѓрѕ│рЅЦ; 
3. рІФрѕЇрЅ░рѕЪрѕІ рѕЏріЋріљрЅх рѕЏрѕерїІрїѕрїФ; 
4. рІерѕўрѕБрѕфрІФ рѕхрѕГрІЊрЅх рѕЁрїјрЅйріЋ рѕўрїБрѕх. 
ріЦрЅБріГрІј рЅ░рїѕрЅбрІЇріЋ рѕўрѕерїЃ рІФрѕерїІрїЇрїА ріЦріЊ ріЦріЋрІ░рїѕріЊ рІФрѕхрїѕрЅА.

q3.answer:
рѕірѕєріЉ рІерѕџрЅйрѕЅ рѕЮріГріЋрІФрЅХрЅй рІерѕџріерЅ░рѕЅрЅхріЋ рІФріФрЅхрЅ│рѕЅ:

1 рЅарЅѓ рІерѕЏрІГрїѕріЮ рѕџрІЏріЋ;

2. рІе SWAP рѕўрїаріЋ ріеріаріљрѕхрЅ░ріЏ рїѕрІ░рЅЦ рЅарЅ│рЅй ріљрІЇ рІѕрІГрѕЮ ріерЇЇрЅ░ріЏрІЇ рІѕрѕ░ріЋ рІГрЅарѕЇрїБрѕЇ;

3. рЅаріарІЇрЅ│рѕе рѕўрѕерЅЦ рѕўрѕѕрІІрІѕрїФрІјрЅй рѕЮріГріЋрІФрЅх рІерЅ░ріерѕ░рЅ░ рІерІІрїІ ріарІхрѕх, ріЦрЅБріГрІј ріЦріЋрІ░рїѕріЊ рІГрѕъріГрѕЕ.

q2.answer:
рІерЅ░рѕѕрѕўрІ▒ рѕЮріГріЋрІФрЅХрЅй рІерѕџріерЅ░рѕЅрЅхріЋ рІФріФрЅхрЅ│рѕЅ:

1. рІерЅ░рѕ│рѕ│рЅ░ рІерѕЏрїЦрЇІрЅх ріарІхрѕФрѕ╗ рІѕрІГрѕЮ рІерѕЏрІГрІ░рїѕрЇЇ рѕ░ріЋрѕ░рѕѕрЅх;

2. рІерѕЏрѕхрІѕрїБрЅх рѕўрїаріЋ ріерЅхріЋрѕ╣ рїѕрІ░рЅЦ рІФріЋрѕ│рѕЇ рѕЏрѕѕрЅх ріљрІЇ;

3. рЅарЅѓ рІерѕЏрІГрїѕріЮ рІФрѕѕ рЅђрѕф рѕѓрѕ│рЅЦ рІѕрІГрѕЮ рІерЅђрІўрЅђрІў рїѕріЋрІўрЅдрЅй;

4. рІФрѕЇрЅ░рѕѕрѕўрІ░ рЅБрѕЁрѕф рІеріарІ░рїІ рЅ░рїІрѕІрїГріљрЅх рЅ░рЅєрїБрїБрѕф рѕєріЌрѕЇ.


ріЦрЅБріГрІј рІерѕўрѕЇрЅђрЅѓрІФ рѕўрѕерїЃрІј рЅхріГріГрѕЇ рѕўрѕєріЉріЋ рІФрѕерїІрїЇрїА. 
рїЦрІФрЅёрІјрЅй ріФрѕЅрІјрЅх рІерѕўрѕБрѕфрІФ рѕхрѕГрІЊрЅх ріарїѕрѕЇрїЇрѕјрЅх ріарїѕрѕЇрїЇрѕјрЅхріЋ рІФріљрїІрїЇрѕЕ.
